import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';
import { flexbox } from '@mui/system';

function Hero() {
  return (
    <Container style={{ background: '#F2E7D6', position: 'relative', padding: '1%', mr: '1%', height:'800px'}}  maxWidth="xl" sx={{ display: 'flex' }}>
        <Grid container spacing = {10} alignContent="flex-start"  alignItems="center" justifyContent="center" sx={{ m: 2 }}> 
        {/* <h1>Hi</h1> */}
        <Grid item xs={5} sx={{ m: 2 }}>
          <Box p={0}>
            <img src = {heroImage} height = "600px" width = "600px"/>
          </Box>
        </Grid>
        <Grid item xs={5}>
          <Box bgcolor="secondary.light" p={0}>
            <h1 style={{fontFamily: 'yeseva one', fontSize: 80, left: "30%"}}>Ideas that build exceptional growth</h1>
          </Box>
          <Grid item>
          <Box bgcolor="secondary.light" p={0}>
            <p style={{fontFamily: 'josefin sans', fontSize: 25}}>Thereâ€™s a smarter way to do business. A way that includes next-level services, a determined, relentless, and passionate consultant, and a unique perspective to help startups, founders, and visionaries get to the next level. </p>
          </Box>
        </Grid>
        <Grid item>
         <Button style={{fontFamily: 'montserrat', color: "white", backgroundColor: "#154D43", borderRadius: 10}}>Schedule a Meeting</Button>
        </Grid>
        </Grid>
        </Grid>
        <Box alignItems="center" justifyContent="center" style={{ backgroundColor: "#CCA06F", borderRadius: 10, position: 'absolute', bottom: "-10px", 'top': '85%','left':' 25%', width: '734px', height: '240px', borderRadius: '30px', zIndex: 3}}>
            <p style={{marginTop:'7%', width: '75%', marginLeft: '15%', color: "white", fontFamily: 'josefin sans', fontSize: 35, lineHeight: '35px'}}>An unwavering commitment to helping entrepreneurs, leaders, and those with big ideas achieve new heights and success.</p> </Box>
    </Container>
  )
}

export default Hero;
